   <>
   <Router>
  <Nav>
    <NavbarContainer>
      <NavLogo to='/'>
      <div>
        MESH
          </div>
        </NavLogo>
        <MobileIcon>
          {click ? <FaTimes /> : <FaBars />}
          </MobileIcon>
      </NavbarContainer>
  </Nav>
  </Router>
   </>
  );
}

export default App;
